import {
  Box,
  TextField,
  Button,
  CloseIcon,
  Typography,
  Paper,
} from '@mui/material';

export default function Signup() {
  const [config, setConfig] = useState({
    name: '',
    email: '',
    password: '',
  });

  let history = useHistory();
  const signup = (e) => {
    e.preventDefault();
    console.log(config);
    history.push('info');
  };
