                    display="flex"
                    flexDirection={"column"}
                    maxWidth={400}
                    height={600}
                    alignItems="center"
                    justifyContent={"center"}
                    margin="auto"
                    marginTop={10}
                    padding={3}
                    borderRadius={5}
                    boxShadow={"5px 5px 10px #ccc"}
                    sx={{
                        ":hover": {
                            boxShadow: "10px 10px 20px #ccc"
                        },
                    }}>
                    <Avatar sx={{ backgroundColor: "#1bbd7e" }}><LockOutlinedIcon /></Avatar>
                    <Typography variant='h4' color="#057dcd" padding={3} textAlign="center">Sign Up</Typography>
                    <Box sx={{ display: "flex", width: 250, justifyContent: "space-between" }}>
                        Register As
                        <input checked={userData.userType=="User"?true:false} type="radio" name="UserType" value="User" onChange={(e) =>
                      setConfig((pv) => ({ ...pv, name: e.target.value }))
                    } />
                        User
                        <input type="radio" name="UserType" value="Admin" onChange={(e) =>
                      setConfig((pv) => ({ ...pv, name: e.target.value }))
                    } />
                        Admin
                    </Box>
                    {userData.userType == "Admin" ? (
                        <TextField
                            id="standard-password-input"
                            label="Secret Key"
                            type="text"
                            variant="standard"
                            autoComplete='off'
                            fullWidth required
                            margin="normal"
                            value={userData.secretKey}
                            onChange={(e) =>
                              setConfig((pv) => ({ ...pv, name: e.target.value }))
                            }
                        />) : null}

                    <TextField
                        id="standard-password-input"
                        label="First Name"
                        type="text"
                        variant="standard"
                        autoComplete='off'
                        fullWidth required
                        margin="normal"
                        value={userData.fName}
                        onChange={(e) =>
                          setConfig((pv) => ({ ...pv, name: e.target.value }))
                        }
                    />
                    <TextField
                        id="standard-password-input"
                        label="Last Name"
                        type="text"
                        variant="standard"
                        autoComplete='off'
                        fullWidth required
                        margin="normal"
                        value={userData.lName}
                        onChange={(e) =>
                          setConfig((pv) => ({ ...pv, name: e.target.value }))
                        }
                    />
                    <TextField
                        id="standard-password-input"
                        label="Email"
                        type="email"
                        variant="standard"
                        autoComplete='off'
                        fullWidth required
                        margin="normal"
                        value={userData.email}
                        onChange={(e) =>
                          setConfig((pv) => ({ ...pv, name: e.target.value }))
                        }
                    />
                    <TextField
                        id="standard-password-input"
                        label="Password"
                        type="password"
                        variant="standard"
                        fullWidth required
                        margin="normal"
                        value={userData.password}
                        onChange={(e) =>
                          setConfig((pv) => ({ ...pv, name: e.target.value }))
                        }
                    />
                    <Button sx={{ marginTop: 3, borderRadius: 3 }} type="submit" variant="contained" fullWidth>Sign up</Button>
                    <Link sx={{ marginTop: 3 }} href="/" variant="body2" >
                        Already have an account? Sign in
                    </Link>
                </Box>
            </form>
